import React from 'react';
import { Link } from "react-router-dom";
import '../style/Accueil.css';
import { motion } from 'framer-motion';
import younesImg from '../images/younes.png';
import maryamImg from '../images/maryam.png';
import wiamImg from '../images/wiam.png';
import ammarImg from '../images/ammar.png';
import hindImg from '../images/hind.png';
import abdelImg from '../images/abdelwadoud.png';
import basmaImg from '../images/basma.png';
import imaneImg from '../images/imane.png';

const members = [
  { name: "Younes TAOUMI", role: "Team Leader", image: younesImg },
  { name: "Maryam BADRI", role: "Vice Team Leader", image: maryamImg },
  { name: "Wiam ABOUTARA BELRHITI", role: "Vice President Project", image: wiamImg },
  { name: "Ammar MASSAOUDI", role: "Communication Manager", image: ammarImg },
  { name: "Hind ZAKY", role: "Human Ressources Manager", image: hindImg },
  { name: "Abdelwadoud EL BAROUJI", role: "Treasurer", image: abdelImg },
  { name: "Basma JAWHAR", role: "Event Manager", image: basmaImg },
  { name: "Imane OUAZZANI CHAHDI", role: "Head of partnerships", image: imaneImg },
];

const projects = [
  {
    name: "Biogazify",
    description: "Convertit les déchets organiques en biogaz pour la cuisine.",
    link: null
  },
  {
    name: "Bistrokabb",
    description: "Valorisation des câpres marocaines, en soutenant les femmes et la cuisine artisanale.",
    link: "https://www.instagram.com/bistro_kabb/?utm_source=ig_web_button_share_sheet"
  },
  {
    name: "Bottle 3D",
    description: "Recycle les bouteilles plastiques en filaments pour imprimantes 3D.",
    link: null
  },
  {
    name: "Educlass Mingle",
    description: "Plateforme éducative combinant réseaux sociaux et études.",
    link: "https://www.instagram.com/educlassmingle?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Enbo",
    description: "Boîtes écologiques à 3 couches fabriquées à partir de matériaux recyclés.",
    link: null
  },
  {
    name: "Potrinov",
    description: "Réinvente la poterie marocaine en alliant tradition et digital.",
    link: "https://www.instagram.com/potrinov.ma?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Reskin",
    description: "Transforme les déchets alimentaires en cosmétiques durables et éco-responsables.",
    link: "https://www.instagram.com/reskincosmetique?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Sitauti",
    description: "Plateforme interactive de soutien pour l’autisme.",
    link: "https://www.instagram.com/sit.auti?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
